import React from 'react'
import Rating from './Rating'
import Container from '@mui/material/Container';

function ScoresAndStats({report}) {
    const accuracy = report['accuracy']
    const classesScores = report['classes_scores']
    const featuresLabels = report['features_labels']
    const classificationType = report['classification_type']

    return (
        <Container maxWidth='md' sx={{width: "90%"}}>

                <Rating value={(accuracy * 5)}/>
                <hr/>
                Model accuracy = {accuracy}
                <hr/>
                * Accuracy may vary from classification to classification.

                {classesScores}
                {featuresLabels}
                Classification Type: {classificationType}


                --Add here confusion matrix and all of the classes f1-scores.
            
        </Container>
    )
}

export default ScoresAndStats
